function magic_string_bundle(inputs, filename = 'bundle.js', separator = '\n') {
	const bundle = new Bundle({ separator });
	inputs.forEach(({ code, filename }) => {
		bundle.addSource({
			filename,
			content: typeof code === 'string' ? new MagicString(code) : code
		});
	});
	return {
		code: bundle.toString(),
		map: bundle.generateMap({
			source: filename,
			hires: true,
			includeContent: false
		})
	};
}

function magic_string_preprocessor_result(filename, src) {
	return {
		code: src.toString(),
		map: src.generateMap({
			source: filename,
			hires: true,
			includeContent: false
		})
	};
}

function magic_string_replace_all(src, search, replace) {
	let idx = src.original.indexOf(search);
	if (idx == -1) throw new Error('search not found in src');
	do {
		src.overwrite(idx, idx + search.length, replace, { storeName: true });
	} while ((idx = src.original.indexOf(search, idx + 1)) != -1);
}

