function is_text_attribute(attribute) {
	return (
		attribute.value !== true && attribute.value.length === 1 && attribute.value[0].type === 'Text'
	);
}

function is_expression_attribute(attribute) {
	return (
		attribute.value !== true &&
		attribute.value.length === 1 &&
		attribute.value[0].type === 'ExpressionTag'
	);
}

function is_event_attribute(attribute) {
	return is_expression_attribute(attribute) && attribute.name.startsWith('on');
}

function extract_identifiers(param, nodes = []) {
	switch (param.type) {
		case 'Identifier':
			nodes.push(param);
			break;

		case 'ObjectPattern':
			for (const prop of param.properties) {
				if (prop.type === 'RestElement') {
					extract_identifiers(prop.argument, nodes);
				} else {
					extract_identifiers(prop.value, nodes);
				}
			}

			break;

		case 'ArrayPattern':
			for (const element of param.elements) {
				if (element) extract_identifiers(element, nodes);
			}

			break;

		case 'RestElement':
			extract_identifiers(param.argument, nodes);
			break;

		case 'AssignmentPattern':
			extract_identifiers(param.left, nodes);
			break;
	}

	return nodes;
}

function extract_identifiers_from_expression(node, nodes = []) {

	switch (node.type) {
		case 'Identifier':
			nodes.push(node);
			break;

		case 'ObjectExpression':
			for (const prop of node.properties) {
				if (prop.type === 'Property') {
					extract_identifiers_from_expression( (prop.value), nodes);
				} else {
					extract_identifiers_from_expression( (prop.argument), nodes);
				}
			}

			break;

		case 'ArrayExpression':
			for (const element of node.elements) {
				if (element) extract_identifiers_from_expression( (element), nodes);
			}

			break;
	}

	return nodes;
}

function extract_paths(param) {
	return _extract_paths(
		[],
		param,
		(node) =>  (node),
		(node) =>  (node)
	);
}

function _extract_paths(assignments = [], param, expression, update_expression) {
	switch (param.type) {
		case 'Identifier':
		case 'MemberExpression':
			assignments.push({
				node: param,
				is_rest: false,
				expression,
				update_expression
			});
			break;

		case 'ObjectPattern':
			for (const prop of param.properties) {
				if (prop.type === 'RestElement') {

					const rest_expression = (object) => {

						const props = [];
						for (const p of param.properties) {
							if (p.type === 'Property' && p.key.type !== 'PrivateIdentifier') {
								if (p.key.type === 'Identifier' && !p.computed) {
									props.push(b.literal(p.key.name));
								} else {
									props.push(p.key);
								}
							}
						}
						return b.call('$.exclude_from_object', expression(object), b.array(props));
					};

					if (prop.argument.type === 'Identifier') {
						assignments.push({
							node: prop.argument,
							is_rest: true,
							expression: rest_expression,
							update_expression: rest_expression
						});
					} else {
						_extract_paths(assignments, prop.argument, rest_expression, rest_expression);
					}
				} else {

					const object_expression = (object) =>
						b.member(expression(object), prop.key, prop.computed || prop.key.type !== 'Identifier');
					_extract_paths(assignments, prop.value, object_expression, object_expression);
				}
			}

			break;

		case 'ArrayPattern':
			for (let i = 0; i < param.elements.length; i += 1) {
				const element = param.elements[i];
				if (element) {
					if (element.type === 'RestElement') {

						const rest_expression = (object) =>
							b.call(b.member(expression(object), b.id('slice')), b.literal(i));
						if (element.argument.type === 'Identifier') {
							assignments.push({
								node: element.argument,
								is_rest: true,
								expression: rest_expression,
								update_expression: rest_expression
							});
						} else {
							_extract_paths(assignments, element.argument, rest_expression, rest_expression);
						}
					} else {

						const array_expression = (object) => b.member(expression(object), b.literal(i), true);
						_extract_paths(assignments, element, array_expression, array_expression);
					}
				}
			}

			break;

		case 'AssignmentPattern': {

			const fallback_expression = (object) =>
				b.call('$.value_or_fallback', expression(object), param.right);
			if (param.left.type === 'Identifier') {
				assignments.push({
					node: param.left,
					is_rest: false,
					expression: fallback_expression,
					update_expression
				});
			} else {
				_extract_paths(assignments, param.left, fallback_expression, update_expression);
			}

			break;
		}
	}

	return assignments;
}

function last_line_length(s) {
	return s.length - s.lastIndexOf('\n') - 1;
}

function sourcemap_add_offset(map, offset, source_index) {
	if (map.mappings.length == 0) return;
	for (let line = 0; line < map.mappings.length; line++) {
		const segment_list = map.mappings[line];
		for (let segment = 0; segment < segment_list.length; segment++) {
			const seg = segment_list[segment];

			if (seg[1] === source_index) {


				if (seg[2] === 0) {
					 (seg[3]) += offset.column;
				}

				 (seg[2]) += offset.line;
			}
		}
	}
}

function merge_tables(this_table, other_table) {
	const new_table = this_table.slice();
	const idx_map = [];
	other_table = other_table || [];
	let val_changed = false;
	for (const [other_idx, other_val] of other_table.entries()) {
		const this_idx = this_table.indexOf(other_val);
		if (this_idx >= 0) {
			idx_map[other_idx] = this_idx;
		} else {
			const new_idx = new_table.length;
			new_table[new_idx] = other_val;
			idx_map[other_idx] = new_idx;
			val_changed = true;
		}
	}
	let idx_changed = val_changed;
	if (val_changed) {
		if (idx_map.find((val, idx) => val != idx) === undefined) {

			idx_changed = false;
		}
	}
	return [new_table, idx_map, val_changed, idx_changed];
}

function combine_sourcemaps(filename, sourcemap_list) {
	if (sourcemap_list.length == 0) return null;
	let map_idx = 1;
	const map =
		sourcemap_list.slice(0, -1).find((m) => m.sources.length !== 1) === undefined
			? remapping(


					sourcemap_list,
					() => null,
					true 
			  )
			: remapping(

					sourcemap_list[0], 
					(sourcefile) => {
						if (sourcefile === filename && sourcemap_list[map_idx]) {
							return sourcemap_list[map_idx++]; 

						} else {
							return null; 
						}
					},
					true
			  );
	if (!map.file) delete map.file; 



	if (!map.sources.length) map.sources = [filename];
	return map;
}

function apply_preprocessor_sourcemap(filename, svelte_map, preprocessor_map_input) {
	if (!svelte_map || !preprocessor_map_input) return svelte_map;
	const preprocessor_map =
		typeof preprocessor_map_input === 'string'
			? JSON.parse(preprocessor_map_input)
			: preprocessor_map_input;
	const result_map = combine_sourcemaps(filename, [svelte_map, preprocessor_map]);


	Object.defineProperties(result_map, {
		toString: {
			enumerable: false,
			value: function toString() {
				return JSON.stringify(this);
			}
		},
		toUrl: {
			enumerable: false,
			value: function toUrl() {
				let b64 = '';
				if (typeof window !== 'undefined' && window.btoa) {

					b64 = window.btoa(unescape(encodeURIComponent(this.toString())));
				} else if (typeof Buffer !== 'undefined') {
					b64 = Buffer.from(this.toString(), 'utf8').toString('base64');
				} else {
					throw new Error(
						'Unsupported environment: `window.btoa` or `Buffer` should be present to use toUrl.'
					);
				}
				return 'data:application/json;charset=utf-8;base64,' + b64;
			}
		}
	});
	return  (result_map);
}

function parse_attached_sourcemap(processed, tag_name) {
	const r_in = '[#@]\\s*sourceMappingURL\\s*=\\s*(\\S*)';
	const regex =
		tag_name == 'script'
			? new RegExp('(?://' + r_in + ')|(?:/\\*' + r_in + '\\s*\\*/)$')
			: new RegExp('/\\*' + r_in + '\\s*\\*/$');




	function log_warning(message) {

		const code_start =
			processed.code.length < 100 ? processed.code : processed.code.slice(0, 100) + ' [...]';

		console.warn(`warning: ${message}. processed.code = ${JSON.stringify(code_start)}`);
	}
	processed.code = processed.code.replace(regex, (_, match1, match2) => {
		const map_url = tag_name == 'script' ? match1 || match2 : match1;
		const map_data = (map_url.match(regex_data_uri) || [])[1];
		if (map_data) {

			if (processed.map) {
				log_warning(
					'Not implemented. ' +
						'Found sourcemap in both processed.code and processed.map. ' +
						'Please update your preprocessor to return only one sourcemap.'
				);

				return '';
			}
			processed.map = atob(map_data); 
			return ''; 
		}

		if (!processed.map) {
			log_warning(
				`Found sourcemap path ${JSON.stringify(
					map_url
				)} in processed.code, but no sourcemap data. ` +
					'Please update your preprocessor to return sourcemap data directly.'
			);
		}

		return ''; 
	});
}

function merge(...tasks) {

	const visitors = {};

	for (const task of tasks) {
		for (const key in task) {
			if (!visitors[key]) visitors[key] = [];
			visitors[key].push(task[key]);
		}
	}



	const combined = {};

	for (const key in visitors) {
		const fns = visitors[key];





		function visitor(node, context) {




			function go(i, state) {
				const fn = fns[i];
				if (!fn) return context.next(state);

				let called_next = false;

				fn(node, {
					...context,
					...overrides,
					state,
					next(next_state = state) {
						called_next = true;
						go(i + 1, next_state);
					}
				});

				if (!called_next) {
					go(i + 1, state);
				}
			}

			go(0, context.state);
		}


		combined[key] = visitor;
	}

	return combined;
}

function create_scopes(ast, root, allow_reactive_declarations, parent) {






	const scopes = new Map();
	const scope = new Scope(root, parent, false);
	scopes.set(ast, scope);


	const state = { scope };


	const references = [];


	const updates = [];





	const possible_implicit_declarations = [];





	function add_params(scope, params) {
		for (const param of params) {
			for (const node of extract_identifiers(param)) {
				scope.declare(node, 'normal', 'param');
			}
		}
	}




	const create_block_scope = (node, { state, next }) => {
		const scope = state.scope.child(true);
		scopes.set(node, scope);

		next({ scope });
	};




	const SvelteFragment = (node, { state, next }) => {
		const scope = analyze_let_directives(node, state.scope);
		scopes.set(node, scope);
		next({ scope });
	};





	function analyze_let_directives(node, parent) {
		const scope = parent.child();

		for (const attribute of node.attributes) {
			if (attribute.type !== 'LetDirective') continue;


			const bindings = [];
			scope.declarators.set(attribute, bindings);



			scopes.set(attribute, scope);

			if (attribute.expression) {
				for (const id of extract_identifiers_from_expression(attribute.expression)) {
					const binding = scope.declare(id, 'derived', 'const');
					bindings.push(binding);
				}
			} else {

				const id = {
					name: attribute.name,
					type: 'Identifier',
					start: attribute.start,
					end: attribute.end
				};
				const binding = scope.declare(id, 'derived', 'const');
				bindings.push(binding);
			}
		}
		return scope;
	}

	walk(ast, state, {

		Identifier(node, { path, state }) {
			const parent = path.at(-1);
			if (parent && is_reference(node,  (parent))) {
				references.push([state.scope, { node, path: path.slice() }]);
			}
		},

		LabeledStatement(node, { path, next }) {
			if (path.length > 1 || !allow_reactive_declarations) return next();
			if (node.label.name !== '$') return next();


			const scope = state.scope.child();
			scopes.set(node, scope);

			if (
				node.body.type === 'ExpressionStatement' &&
				node.body.expression.type === 'AssignmentExpression'
			) {
				for (const id of extract_identifiers(node.body.expression.left)) {
					if (!id.name.startsWith('$')) {
						possible_implicit_declarations.push(id);
					}
				}
			}

			next({ scope });
		},

		SvelteFragment,
		SvelteElement: SvelteFragment,
		RegularElement: SvelteFragment,

		Component(node, { state, visit, path }) {
			state.scope.reference(b.id(node.name), path);



			for (const attribute of node.attributes) {
				visit(attribute);
			}

			const scope = analyze_let_directives(node, state.scope);
			scopes.set(node, scope);

			for (const child of node.fragment.nodes) {
				if (
					is_element_node(child) &&
					child.attributes.some(
						(attribute) => attribute.type === 'Attribute' && attribute.name === 'slot'
					)
				) {

					scopes.set(child, state.scope);
					visit(child);
				} else if (child.type === 'SnippetBlock') {
					visit(child);
				} else {
					visit(child, { scope });
				}
			}
		},


		AssignmentExpression(node, { state, next }) {
			updates.push([state.scope, node.left]);
			next();
		},

		UpdateExpression(node, { state, next }) {
			updates.push([
				state.scope,
				 (
					node.argument
				)
			]);
			next();
		},

		ImportDeclaration(node, { state }) {
			for (const specifier of node.specifiers) {
				state.scope.declare(specifier.local, 'normal', 'import', node);
			}
		},

		FunctionExpression(node, { state, next }) {
			const scope = state.scope.child();
			scopes.set(node, scope);

			if (node.id) scope.declare(node.id, 'normal', 'function');

			add_params(scope, node.params);
			next({ scope });
		},

		FunctionDeclaration(node, { state, next }) {
			if (node.id) state.scope.declare(node.id, 'normal', 'function', node);

			const scope = state.scope.child();
			scopes.set(node, scope);

			add_params(scope, node.params);
			next({ scope });
		},

		ArrowFunctionExpression(node, { state, next }) {
			const scope = state.scope.child();
			scopes.set(node, scope);

			add_params(scope, node.params);
			next({ scope });
		},

		ForStatement: create_block_scope,
		ForInStatement: create_block_scope,
		ForOfStatement: create_block_scope,
		BlockStatement: create_block_scope,
		SwitchStatement: create_block_scope,

		ClassDeclaration(node, { state, next }) {
			if (node.id) state.scope.declare(node.id, 'normal', 'const', node);
			next();
		},

		VariableDeclaration(node, { state, path, next }) {
			const is_parent_const_tag = path.at(-1)?.type === 'ConstTag';
			for (const declarator of node.declarations) {

				const bindings = [];

				state.scope.declarators.set(declarator, bindings);

				for (const id of extract_identifiers(declarator.id)) {
					const binding = state.scope.declare(
						id,
						is_parent_const_tag ? 'derived' : 'normal',
						node.kind,
						declarator.init
					);
					bindings.push(binding);
				}
			}

			next();
		},

		CatchClause(node, { state, next }) {
			if (node.param) {
				const scope = state.scope.child(true);
				scopes.set(node, scope);

				for (const id of extract_identifiers(node.param)) {
					state.scope.declare(id, 'normal', 'let');
				}

				next({ scope });
			} else {
				next();
			}
		},

		EachBlock(node, { state, visit }) {


			const references_within = new Set();
			const idx = references.length;
			visit(node.expression);
			for (let i = idx; i < references.length; i++) {
				const [scope, { node: id }] = references[i];
				if (scope === state.scope) {
					references_within.add(id);
				}
			}
			scopes.set(node.expression, state.scope);


			const scope = state.scope.child();
			scopes.set(node, scope);


			for (const id of extract_identifiers(node.context)) {
				scope.declare(id, 'each', 'const');
			}
			if (node.context.type !== 'Identifier') {
				scope.declare(b.id('$$item'), 'derived', 'synthetic');
			}

			if (node.index) {
				const is_keyed =
					node.key &&
					(node.key.type !== 'Identifier' || !node.index || node.key.name !== node.index);
				scope.declare(b.id(node.index), is_keyed ? 'derived' : 'normal', 'const');
			}
			if (node.key) visit(node.key, { scope });


			for (const child of node.body.nodes) {
				visit(child, { scope });
			}
			if (node.fallback) visit(node.fallback, { scope });




			let needs_array_deduplication = false;
			for (const [name] of scope.declarations) {
				if (state.scope.get(name) !== null) {
					needs_array_deduplication = true;
				}
			}

			node.metadata = {
				contains_group_binding: false,
				array_name: needs_array_deduplication ? state.scope.root.unique('$$array') : null,
				index: scope.root.unique('$$index'),
				item_name: node.context.type === 'Identifier' ? node.context.name : '$$item',
				references: [...references_within]
					.map((id) =>  (state.scope.get(id.name)))
					.filter(Boolean),
				is_controlled: false
			};
		},

		AwaitBlock(node, context) {
			context.next();

			if (node.then && node.value !== null) {
				const then_scope =  (scopes.get(node.then));
				const value_scope = context.state.scope.child();
				for (const id of extract_identifiers(node.value)) {
					then_scope.declare(id, 'normal', 'const');
					value_scope.declare(id, 'normal', 'const');
				}
				scopes.set(node.value, value_scope);
			}

			if (node.catch && node.error !== null) {
				const catch_scope =  (scopes.get(node.catch));
				const error_scope = context.state.scope.child();
				for (const id of extract_identifiers(node.error)) {
					catch_scope.declare(id, 'normal', 'const');
					error_scope.declare(id, 'normal', 'const');
				}
				scopes.set(node.error, error_scope);
			}
		},

		SnippetBlock(node, context) {
			const state = context.state;

			const is_top_level = !context.path.at(-2);
			let scope = state.scope;
			if (is_top_level) {
				scope =  (parent);
			}
			scope.declare(node.expression, 'normal', 'function', node.expression);

			const child_scope = state.scope.child();
			scopes.set(node, child_scope);

			if (node.context) {
				for (const id of extract_identifiers(node.context)) {
					child_scope.declare(id, 'each', 'let');
				}
			}

			context.next({ scope: child_scope });
		},

		Fragment: (node, context) => {
			const scope = context.state.scope.child(node.transparent);
			scopes.set(node, scope);
			context.next({ scope });
		},

		BindDirective(node, context) {
			updates.push([
				context.state.scope,
				 (
					node.expression
				)
			]);
			context.next();
		},

		ConstTag(node, { state, next }) {
			const declaration = node.declaration.declarations[0];
			for (const identifier of extract_identifiers(declaration.id)) {
				state.scope.declare(
					 (identifier),
					'derived',
					'const'
				);
			}
			next();
		}


	});

	for (const id of possible_implicit_declarations) {
		const binding = scope.get(id.name);
		if (binding) continue; 

		scope.declare(id, 'legacy_reactive', 'let');
	}



	for (const [scope, { node, path }] of references) {
		scope.reference(node, path);
	}

	for (const [scope, node] of updates) {
		if (node.type === 'MemberExpression') {
			let object = node.object;
			while (object.type === 'MemberExpression') {
				object = object.object;
			}

			const binding = scope.get( (object).name);
			if (binding) binding.mutated = true;
		} else {
			extract_identifiers(node).forEach((identifier) => {
				const binding = scope.get(identifier.name);
				if (binding) binding.mutated = true;
			});
		}
	}

	return {
		scope,
		scopes
	};
}

function set_scope(scopes) {
	return {





		_(node, { next, state }) {
			const scope = scopes.get(node);
			next(scope !== undefined && scope !== state.scope ? { ...state, scope } : state);
		}
	};
}

function get_rune(node, scope) {
	if (!node) return null;
	if (node.type !== 'CallExpression') return null;

	let n = node.callee;

	let joined = '';

	while (n.type === 'MemberExpression') {
		if (n.computed) return null;
		if (n.property.type !== 'Identifier') return null;
		joined = '.' + n.property.name + joined;
		n = n.object;
	}

	if (n.type !== 'Identifier') return null;

	joined = n.name + joined;
	if (!Runes.includes(joined)) return null;

	const binding = scope.get(n.name);
	if (binding !== null) return null; 

	return joined;
}

function is_element_node(node) {
	return element_nodes.includes(node.type);
}

function is_custom_element_node(node) {
	return node.name.includes('-');
}

function create_attribute(name, start, end, value) {
	return {
		type: 'Attribute',
		start,
		end,
		name,
		value,
		parent: null,
		metadata: {
			dynamic: false,
			delegated: null
		}
	};
}

function validate_component(node, context) {
	for (const attribute of node.attributes) {
		if (
			attribute.type !== 'Attribute' &&
			attribute.type !== 'SpreadAttribute' &&
			attribute.type !== 'LetDirective' &&
			attribute.type !== 'OnDirective' &&
			attribute.type !== 'BindDirective'
		) {
			error(attribute, 'invalid-component-directive');
		}
	}

	context.next({
		...context.state,
		parent_element: null,
		component_slots: new Set()
	});
}

function validate_element(node, context) {
	for (const attribute of node.attributes) {
		if (
			attribute.type === 'Attribute' &&
			attribute.name === 'is' &&
			context.state.options.namespace !== 'foreign'
		) {
