function withFilter (subscribeFn, filterFn) {
  return async function * (root, args, context, info) {
    const subscription = await subscribeFn(root, args, context, info)
    for await (const payload of subscription) {
      try {
        if (await filterFn(payload, args, context, info)) {
          yield payload
        }
      } catch (err) {
        context.app.log.error(err)
        continue
      }
    }
  }
}

function createConnectionHandler ({ subscriber, fastify, onConnect, onDisconnect, entityResolversFactory, subscriptionContextFn, keepAlive, fullWsTransport, errorFormatter }) {
  return async (connection, request) => {
    const { socket } = connection

    if (socket.protocol === undefined || getProtocolByName(socket.protocol) === null) {
      request.log.warn('wrong websocket protocol')



      socket.close(1002)

      return
    }

    let context = {
      app: fastify,
      pubsub: subscriber,
      request
    }

    if (context.app.graphql && context.app.graphql[kHooks]) {
      context = assignLifeCycleHooksToContext(context, context.app.graphql[kHooks])
    } else {
      context = assignLifeCycleHooksToContext(context, new Hooks())
    }

    let resolveContext

    if (subscriptionContextFn) {
      resolveContext = () => subscriptionContextFn(connection, request)
    }

    const subscriptionConnection = new SubscriptionConnection(socket, {
      subscriber,
      fastify,
      onConnect,
      onDisconnect,
      entityResolversFactory,
      context,
      resolveContext,
      keepAlive,
      fullWsTransport,
      errorFormatter
    })


    connection.socket.on('error', () => {
      subscriptionConnection.close()
    })
    connection.socket.on('close', () => {
      subscriptionConnection.close()
    })
  }
}

function toGraphQLError (err) {
  if (err instanceof GraphQLError) {
    return err
  }

  const gqlError = new GraphQLError(
    err.message,
    err.nodes,
    err.source,
    err.positions,
    err.path,
    err,
    err.extensions
  )

  gqlError.locations = err.locations

  return gqlError
}

function defaultErrorFormatter (execution, ctx) {

  const log = ctx.reply ? ctx.reply.log : ctx.app.log

  let statusCode = execution.data ? 200 : (execution.statusCode || 200)

  const errors = execution.errors.map((error) => {
    log.info({ err: error }, error.message)


    if (error.originalError?.errors) {

      return error.originalError.errors.map(toGraphQLError)
    }

    return error



  }).reduce((acc, val) => acc.concat(val), []).map((error) => error.toJSON())


  if (!execution.data && typeof execution.statusCode === 'undefined' && execution.errors.length > 0) {
    if (errors.length === 1) {

      if (typeof execution.errors[0].originalError !== 'undefined' && typeof execution.errors[0].originalError.statusCode === 'number') {
        statusCode = execution.errors[0].originalError.statusCode

      } else {
        statusCode = 200
      }
    }
  }

  return {
    statusCode,
    response: {
      data: execution.data || null,
      errors
    }
  }
}

function addErrorsToExecutionResult (execution, errors) {
  if (errors) {
