(context, fromVersion, toVersion, optionalPercent = '100%') => {
  if (!toVersion) {
    context.line(
      'Must provide both old and new version like `zapier migrate 1.0.0 1.0.1`.'
    );
    return Promise.resolve();
  }
  optionalPercent = parseInt(optionalPercent, 10);
  const user = global.argOpts.user;

  return utils
    .getLinkedApp()
    .then(app => {
      if (user && optionalPercent !== 100) {
        throw new Error(
          'Cannot define percent and user. Use only one or the other.'
        );
      }

      let promoteFirst = false;
      if (
        optionalPercent === 100 &&
        !user &&
        app.public &&
        toVersion !== app.latest_version
      ) {
        context.line(
          `You're trying to migrate all the users to ${toVersion}, ` +
            'which is not the current production version.'
        );
        promoteFirst = utils.getYesNoInput(
          `Do you want to promote ${toVersion} to production first?`
        );
      }
      return Promise.all([app, promoteFirst]);
    })
    .then(([app, promoteFirst]) => {
      let promotePromise = null;
      if (promoteFirst) {
        promotePromise = promote(context, toVersion, false);
      }
      return Promise.all([app, promotePromise]);
    })
    .then(([app]) => {
      const body = {
        percent: optionalPercent
      };

      if (user) {
        body.user = user;

        context.line(
          `Getting ready to migrate "${user}" in your app "${
            app.title
          }" from ${fromVersion} to ${toVersion}.\n`
        );
        utils.startSpinner(
          `Starting migration from ${fromVersion} to ${toVersion} for ${user}`
        );
      } else {
        context.line(
          `Getting ready to migrate your app "${
            app.title
          }" from ${fromVersion} to ${toVersion}.\n`
        );
        utils.startSpinner(
          `Starting migration from ${fromVersion} to ${toVersion} for ${optionalPercent}%`
        );
      }

      return utils.callAPI(
        `/apps/${app.id}/versions/${fromVersion}/migrate-to/${toVersion}`,
        {
          method: 'POST',
          body
        }
      );
    })
    .then(() => {
      utils.endSpinner();
      context.line(
        '\nMigration successfully queued, please check `zapier history` to track the status. Migrations usually take between 5-10 minutes.'
      );
    });
}

styleResult => {
  let res = [];
  const docURL =
    'https://zapier.com/developer/documentation/v2/style-checks-reference';
  for (const severity in styleResult) {
    for (const type in styleResult[severity]) {
      for (const method in styleResult[severity][type]) {

        for (const message of styleResult[severity][type][method]) {
          res.push({
            category: severity,
            method: `${type}.${method}`,
            description: message,
            link: `${docURL}#${message.substr(-7, 6)}`
          });
        }
      }
    }
  }

  return res;
}

async context => {
  context.line('\nValidating project locally.');
  const errors = await utils.localAppCommand({ command: 'validate' });

  const newErrors = errors.map(error => {
    error = _.extend({}, error);
    error.property = error.property.replace('instance.', 'App.');
    error.docLinks = (error.docLinks || []).join('\n');
    return error;
  });
  let ifEmpty = colors.grey(
    'No structural errors found during validation routine.'
  );
  utils.printData(
    newErrors,
    [['Property', 'property'], ['Message', 'message'], ['Links', 'docLinks']],
    ifEmpty,
    true
  );

  if (newErrors.length) {
    context.line(
      'Your app is structurally invalid. Address concerns and run this command again.'
    );
    process.exitCode = 1;
  } else {
    context.line('This project is structurally sound!');
  }

  let styleResult = [];

  if (global.argOpts['without-style'] || process.exitCode === 1) {
    if (process.exitCode === 1) {

      context.line(
        colors.grey('\nSkipping app style check because app did not validate.')
      );
    }
    return;
  } else {
    context.line('\nChecking app style.');
    const rawDefinition = await utils.localAppCommand({
      command: 'definition'
    });

    styleResult = await utils.callAPI('/style-check', {
      skipDeployKey: true,
      method: 'POST',
      body: rawDefinition
    });
  }


  let styleErrors = condenseIssues(styleResult);
  ifEmpty = colors.grey('No style errors found during validation routine.');

  utils.printData(
    styleErrors,
    [
      ['Category', 'category'],
      ['Method', 'method'],
      ['Description', 'description'],
      ['Link', 'link']
    ],
    ifEmpty,
    true
  );


  if (styleErrors.filter(error => error.category === 'errors').length) {
    process.exitCode = 1;
    context.line(
      'Errors will prevent promotions, warnings are things to improve on.\n'
    );
  } else {
    context.line('Your app looks great!\n');
  }
}

(context, version, printMigrateHint = true) => {
  if (!version) {
    context.line('Error: No deploment/version selected...\n');
    return Promise.resolve();
  }

  let app, changelog;

  return utils
    .checkCredentials()
    .then(() =>
      Promise.all([utils.getLinkedApp(), utils.getVersionChangelog(version)])
    )
    .then(([foundApp, foundChangelog]) => {
      app = foundApp;
      changelog = foundChangelog;

      context.line(
        `Preparing to promote version ${version} of your app "${app.title}".\n`
      );

      let shouldContinue = false;

      if (changelog) {
        context.line(colors.green(`Changelog found for ${version}!`));
        context.line(`\n---\n${changelog}\n---\n`);

        shouldContinue = utils.getYesNoInput(
          'Would you like to continue promoting with this changelog?',
          false
        );
      } else {
        context.line(
          `${colors.yellow(
            'Warning!'
          )} Changelog not found. Please create a \`CHANGELOG.md\` file in a format similar to ${colors.cyan(
            'https://gist.github.com/xavdid/b9ede3565f1188ce339292acc29612b2'
          )}, with user-facing descriptions.\n`
        );

        shouldContinue = utils.getYesNoInput(
          'Would you like to continue promoting without a changelog?',
          false
        );
      }
      return shouldContinue;
    })
    .then(shouldContinue => {
      context.line();
      if (!shouldContinue) {
        throw new Error('Cancelled promote.');
      }

      const url = `/apps/${app.id}/versions/${version}/promote/production`;
      const body = {};

      if (changelog) {
        body.changelog = changelog;
      }

      utils.startSpinner(`Verifying and promoting ${version}`);
      return utils.callAPI(
        url,
        {
          method: 'PUT',
          body
        },
        true
      );
    })
    .then(() => {
      utils.endSpinner();
      context.line('  Promotion successful!\n');
      if (printMigrateHint) {
        context.line(
          'Optionally, run the `zapier migrate` command to move users to this version.'
        );
      }
    })
    .catch(response => {
      // we probalby have a raw response, might have a thrown error
      // The server 403s when the app hasn't been approved yet
      if (_.get(response, 'json.activationInfo')) {
        utils.endSpinner();
        context.line(
