      let val = arg
        .split('=')
        .slice(1)
        .join('=');
      if (val === '') {
        val = true;
      } else if (val.toLowerCase() === 'false') {
        val = false;
      }
      opts[key] = val;
    } else if (arg.startsWith('-') && arg.length === 2) {
