(version, markdown) => {
  const lines = markdown
    .replace(/\r\n/g, '\n')
    .replace(/\r/g, '\n')
    .split('\n');

  let startingLine = _.findIndex(
    lines,
    line => line.indexOf(`## ${version}`) === 0
  );

  if (startingLine === -1) {
    return '';
  }


  startingLine += 2;

  let endingLine = _.findIndex(
    lines,
    line => line.indexOf('## ') === 0,
    startingLine
  );

  if (endingLine === -1) {
    endingLine = lines.length;
  }


  endingLine -= 1;

  const changelogLines = lines.slice(startingLine, endingLine);

  return changelogLines.join('\n');
}

